import React from "react"
import ReactDOM from "react-dom"

function Test(){
    
    const date = new Date
    hours = date.getHours 
    let timeOfDay

    if (hours>2 && hours<12 ){
        timeOfDay = "Morning"
    }
    else if(hours>12 && hours<16){
        timeOfDay = "Afternoon"
    }
    
    else if(hours>16){
        timeOfDay = "Evining"
    }

    return(
        <div>
            <h1>Hello. Good {timeOfDay}</h1>
        </div>
    )
}

ReactDOM.render(<Test/>,document.getElementById("root"))
